            <div className="footer-links">
              <a href="#">About Us</a>
              <a href="#">Contact</a>
              <a href="#">Support</a>
              <a href="#">FAQ</a>
              <a href="#">Terms</a>
              <a href="#">Privacy</a>
            </div>
